import Hero from '../components/Hero';
import NavBar from '../components/NavBar';
import ImageSrc from "../asserts/About.jpg"


export default function About(){
    return(
        <>
            <NavBar/>
            {/* <h1>This is About</h1> */}
            <Hero
                cName="hero-a"
                src= {ImageSrc}
                title="About Us"

            />
        </>
    );
}
